import React from "react";
import { IProducts } from "types/product.types";

interface IPage extends IProducts {
  picture: string;
}

const Products = ({ picture }: IPage) => {
  return (
    <div>
      <div className="card">
        <img src={picture} alt="" />
        <p>Tag: SoftWare</p>
      </div>
    </div>
  );
};

export default Products;
